safely_remove_extraction_directory (){
   # Takes 1 arg:       Arg 1 is extraction directory to remove
   pushd /tmp &>$DN
   find $1 -type d -exec rmdir -p {} \; 2>$DN
   popd &>$DN
}
scn_ln (){
   if [ $(echo $SRC|grep [0-9\.]) ];then
      MENV=$(echo $SRC |awk -F \. '{print $1FS$2FS$3}')
   elif [ $(IP|wc -l) -gt 1 ];then
      MENV=$MENV
   else
      MENV=IP
      MENV=$($MENV| awk -F \. '{print $1FS$2FS$3}')
   fi
   echo Scanning $MENV
   echo "-----------------------"
   for j in $(seq 1 253);do
      echo $MENV.$j >> $ENAM.$$
   done
   $KSCN $ENAM.$$ 2>&1 | \
      awk '{print $1}' | \
      grep -v \\\# | \
      grep -Ev "([[:alpha:]]|^\.)" | \
      grep -v [0-9][0-9][0-9][0-9] | \
      sed 's/\.\([0-9]\)$/.00\1/g'|sed 's/\.\([0-9][0-9]\)$/.0\1/g'|sort -u|sort -n|sed 's/\.00\([0-9]\)$/.\1/g'|sed 's/\.0\([0-9][0-9]\)$/.\1/g' | \
      tee list.now.$$
      echo "-----------------------"
      echo "Total $(wc -l list.now.$$|awk '{print $1}')"
   rm $ENAM.$$
}
